import React from "react";

const Navbar = () => {
    return (
        <div className="nav">
            <nav>
                <div>
                    <a>Profile</a>
                </div>
                <div>
                    <a>Messages</a>
                </div>
                <div>
                    <a>News</a>
                </div>
                <div>
                    <a>Music</a>
                </div>
                <div>
                    <a>Settings</a>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
